import React from 'react';

function Form(props) {
    return (
        <div className="form">
            <div className="form-group">
                <input type="text" name={props.name} value={props.value}></input>
            </div>
            <button onClick = {props.onClick} className="btn btn-success mt-2">Search</button>
        </div>
    )
};

export default Form;
